import Header from "../commons/Header/Header"
import Footer from "../commons/Footer/Footer"

const MainPage = ({data}) => {

    return (
        <section className="mainPage">
            <Header />
            <>
                <h2>Welcome </h2>
                {data.map((people, i) => {
                    return (
                        <div  key={i}>
                            <p>{people.name} </p>
                        </div>

                    )
                })}

            </>
            <Footer />

        </section>

    )
}

export default MainPage;
